// frontend/src/pages/Dashboard.js
import React from 'react';

const Dashboard = () => {
  return (
    <div className="container">
      <h1>Admin Dashboard</h1>
      <p>Admin dashboard content will be implemented here.</p>
    </div>
  );
};

export default Dashboard;
